import React from "react";

const CheckoutPage = () => {
  return (
    <div className='checkout-page'>
      <div className='checkout-page-header'>
        <span>Product</span>
        <span>Name</span>
        <span>Quantity</span>
        <span>Price</span>
      </div>
    </div>
  )
}

export default CheckoutPage;
